def str_to_binary(s: str) -> str: return "".join(f"{ord(i):08b}" for i in s)

def binary_to_str(b: str) -> str:
    n = 8
    return "".join([chr(int(b[i:i + n], 2)) for i in range(0, len(b), n)])
    
def transform(message: str, key: str) -> str:
    result = ""
    
    for i in range(len(message)):
        a = message[i] == "1"
        b = key[i % len(key)] == "1"
        
        result += str(int(a ^ b))

    return result

